/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {
    return (
      <div>
        {Object.values(this.props.movies).map(
          ({ original_title, overview, popularity }, key) => (
            <ul key={key}>
              <li>{original_title}</li>
              <li>{overview}</li>
              <li>{popularity}</li>
            </ul>
          )
        )}
      </div>
    );
  }
}

export default MovieList;
